import React from 'react'
import './Home.css'
import Banner from './component/Banner';

import HomeBanner from '../../Img/Home_topBanner.png';
import HomeBanner2 from '../../Img/Home_topBannerBottom.png';
import HomeTopCloud1 from '../../Img/Home_topCloud1.png';
import HomeTopCloud2 from '../../Img/Home_topCloud2.png';
import HomeTitle from '../../Img/Home_topTitle.png';

const Home = () => {
  return (
    <>
    <div className='Home-flex'></div>
    <div className='Home-wrap'>
    <div className='Section-1'>
    <h1>Home</h1>
    </div>
    </div>
    </>
  )
}

export default Home
